import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ViewUsers() {
    const [users, setUsers] = useState([]);
    const currentUserID = localStorage.getItem('currentUserID'); // Replace with actual logic to get current user's ID

    useEffect(() => {
        const token = localStorage.getItem('token');
        axios.get('/api/user/self', { headers: { authorization: `Bearer ${token}` } })
            .then(response => {
                // Filter to include only the current user's data
                const currentUserData = response.data.filter(user => user.id === currentUserID);
                setUsers(currentUserData);
            })
            .catch(error => {
                console.error('Error fetching users:', error);
            });
    }, [currentUserID]);

    return (
        <div>
            <h2>Current User</h2>
            <ul>
                {users.map(user => (
                    <li key={user.id}>{user.name} - {user.phone}</li>
                ))}
            </ul>
        </div>
    );
}

export default ViewUsers;
